import React, { Component } from 'react';
import Link from 'next';
import Meta from './Meta';
import SideNav from './SideNav';
import Header from './Header';

class Page extends Component {
  render() {
    return (
      <div>
        <Meta />
        {/* <TopBar /> */}
        <div className="flex">
          <Header />

          <SideNav />
          {this.props.children}
        </div>
      </div>
    );
  }
}

export default Page;
